d optimization'), ('104', '已提交', 'Submitted'), ('105', '提交', 'Submit'), ('106', '2016年度成功设计大赛新春启动会在沪成功举办', '2016 Successful Design Awards are open'), ('107', '国内首个评估设计商业和社会价值的<br/>全球综合类设计大赛', 'What is Successful Design Award ?'), ('108', '成功设计大赛是中国最具影响力的国际化商业设计大赛。', 'Successful Design Award is the first international awards to evaluate designs based on their business & social impact.'), ('109', '创立于2006年，历经多年辉煌积淀，它已成为设计创新与管理的标杆。不同于其他设计赛事，成功设计大赛不仅仅关注设计风格，更注重的是从管理者的角度审视设计，挖掘设计背后的策略、流程以及对企业、社会、环境、人类生活带来的价值和深远影响。', 'SuccessfulDesign.org created the Successful Design Awards to reward and empower the individuals, teams and companies that make up our industry. We have spent the last 10 years raising the profile of design among industry, academia and media circles.'), ('110', '我们的舞台既有众多知名企业科勒、飞利浦、惠普、奔驰、宝马、海尔、长虹等，也有恩诺童、Parallaxe在此一夜成名，被打造成知名设计品牌。至今，已有超过20多个国家、20多个行业，1200名的参赛企业获得了成功设计大赛的殊荣。', 'We work with a team of global leaders to make a difference by recognizing excellence in designs and innovations that create positive social and strategic impact and not just market success. '), ('111', '立即参加', 'Register Now'), ('112', '大赛类别', 'Project Categories'), ('113', '我们欢迎所有对中国市场产生积极影响的设计师和设计企业前来参赛。', 'Designers and companies looking to actively create a positive impact and influence in the Chinese market are welcomed to participate.'), ('114', '其设计作品需在 <span style=\"color:#f90;\">2016年10月前在中国市场上市或已发布</span>', 'Our only caveat is that your submission is restricted to products developed during 2015 <span style=\"color:#f90;\">and/or launched by October 2016</span>.'), ('115', '点击类别查看详细分类', 'Click categories for the details'), ('116', '商业<br/>模式', 'Business<br/>Model'), ('117', '社会<br/>创新', 'Social<br/>Innovation'), ('118', '众创<br/>空间', 'Creative<br/>Space'), ('119', '电子、通信及数码产品', 'Digital and electronic devices'), ('120', '工业机械及工具', 'Tools and Machinery'), ('121', '家居及家用电器类', 'Home ware'), ('122', '办公类用品', 'Office ware'), ('123', '医疗设备', 'Health medical and safety'), ('124', '娱乐设备'