ns. Winners of the Successful Design Awards will have the opportunity to be interviewed by our media partners either free or if partners require at a discount.'), ('161', '证书与奖杯', 'Certificate and Trophy'), ('162', '颁奖典礼当日，获奖者将获得一套相关获奖作品的获奖证书和奖杯，以彰显获奖者的殊荣。另外在活动后，获奖者可以获得自己的电子版获奖证书，以作宣传使用。', 'After the results are announced, each winner will receive a certificate and trophy to honor their achievement. Meanwhile, they can download the digital file of the certificate online.'), ('163', '成功设计之夜', 'Successful Design Night - Awards Ceremony'), ('164', '获奖者将受邀参加于2016年9月举行的“ 成功设计之夜”颁奖典礼。最成功设计大奖得主将在聚光灯下接受颁奖。届时将有各大主流媒体前来报道， 是您进行品牌宣传的极好机会。另外也会有专业摄影师拍照记录，照片可在活动后下载，作为您宣传的助力。', 'The ceremony provides you the opportunity to exchange ideas with international design leaders, and rub shoulders with industry and brand leader. We invite you to seize your moment under the spotlight and showcase your credentials to our professional audience of media and potential business partners.'), ('165', '成功设计大奖年鉴', 'Awards Yearbook'), ('166', '今年所有获奖作品将被收录入《2016 成功设计大赛》年鉴，以展示获奖作品、分享成功设计和团队背后的故事。', 'All winning entries will be profiled in the 2016 Successful Design Awards Yearbook, acknowledged by the global design community as an invaluable reference tool for gauging the cutting edge of design and identifying design leaders in China. All award winners will receive a copy of yearbooks.'), ('167', '成功设计线上展览', 'Online Exhibition'), ('168', '您的获奖作品将在颁奖典礼后发布于成功设计线上展览，更棒的是这是一项永久福利，展览没有时间限制！您将成为行业标杆之一，名列杰出企业之列。这更是为您提供与社会大众交流的平台，以提高您的品牌影响力。', 'All winners will be profiled in both English and Chinese on the Successful Design Awards website. These profiles will be permanently displayed.'), ('169', '成功设计标识', 'Endorsement Mark'), ('170', '获奖标识只要您的参赛作品获奖，您就可以使用成功设计标识。成功设计标识的使用不受时间或区域限制，线上线下、广告新闻均可使用。得奖者可在成功设计平台官网下载获奖标识。', 'Once the competition results have been announced winners will be granted the right to display the Successful Design Awards Endorsement Mark on their promotion materials and describe themselves as winners of the Successful Design Awards 2015.'), ('171', '大赛时间表', 'Timeline'), ('172', '奖项设置', 'Awards Categories'), ('173', '重置密码', 'Reset Password'), ('174', '请输入注册邮箱', 'Please enter the registration email'), ('175', '重置邮件已发送，请登录您的邮箱查收', 'The resetting email has been sent, please check your mailbox '), ('176', '已有账号', 'Login'), ('177', '注册账号', 'Sign Up'), ('178', '账号登录', 'Login'), ('179', '密码', 'Password'), ('180', '注册账号', 'Sign Up'), ('181', '忘记密码', 'Forget Password'), ('182', '登陆', 'Login'), ('183', '账号注册', 'Sign Up'), ('184', '重复密码', 'Repeat Password'), ('185', '已经激活？前往登陆', 'Login'), ('186', '账号激活', 'Activate Account'), ('187', '激活邮件已发送，请激活邮箱后登陆', 'The email for activation has been sent, please check your mailbox'), ('188', '没有收到邮件？', 'No email received?'), ('189', '重发', 'Resend'), ('190', '输入新密码', 'Enter new password'), ('191', '重复新密码', 'Repeat new password'), ('192', '编辑', 'Edit'), ('193', '公司地址（中文）', 'Company Address (Chinese)'), ('194', '公司地址（英文）', 'Company Address (English)'), ('195', '传真', 'Fax'), ('196', '邮编', 'Zipcode'), ('197', '更换头像', 'Change Portrait'), ('198', '昵称', 'Nickname'), ('199', '性别', 'Gender'), ('200', '男', 'Male'), ('201', '女', 'Female'), ('202', '已支付', 'Paid'), ('203', '未支付', 'Unpaid'), ('204', '未提交', 'Unsubmitted'), ('205', '支付', 'Pay'), ('206', '补充文件', 'Complementary File'), ('207', '全部作品', 'All'), ('208', '信息未完成', 'Incomplete'), ('209', '未付款作品', 'Unpaid'), ('210', '未提交作品', 'Unsubmitted'), ('211', '作品名称', 'Entry Name'), ('212', '信息完整度', 'Details'), ('213', '作品状态', 'Entry Status'), ('214', '操作', ''), ('215', '详情', 'Details'), ('217', '* 早鸟报名开放至3月31日（1800RMB）', '* Early bird registration close on March 31th (1800 RMB)'), ('218', '** 一般报名开放至5月31日（2000RMB）', '** Hard line registration close on May 31th (2000 RMB)'), ('219', '*** 获奖者需支付后期宣传推广费用（3000RMB）', '*** All of the winners shall pay 3000 RMB for the promotion after winning'), ('220', '年度成功市场价值营销大奖', 'Market Value'), ('221', '年度成功绿色设计大奖', 'Green Design'), ('222', '年度成功社会影响大奖', 'Soci